import React, { Component } from 'react';
import { Button, Nav, NavDropdown } from 'react-bootstrap';
import Navbar from 'react-bootstrap/Navbar'
// import './Header.css';

class Header extends Component {
    render() { 
        return (
            <header className="header">
                <Navbar bg="light" variant="light" class="nav">
                    <div class="container">
                        <Button class="navbar-toggler"
                        type="button"
                        data-bs-toggle="collapse"
                        data-bs-target="#navmenu">
                            <span class="navbar-toggle-icon"/>
                        </Button>
                        <div class="collapse navbar-collapse" id="#navmenu">
                        <Navbar.Brand href="#home">Home</Navbar.Brand>
                        <Nav className="me-auto">
                            <Nav.Link href="#features">About</Nav.Link>
                            <NavDropdown title="Shop" id="basic-nav-dropdown">
                              <NavDropdown.Item href="#action/3.1">All products</NavDropdown.Item>
                              <NavDropdown.Divider />
                              <NavDropdown.Item href="#action/3.2">Popular items</NavDropdown.Item>
                              <NavDropdown.Item href="#action/3.3">New arrivals</NavDropdown.Item>
                            </NavDropdown>
                            <Button className="ms-auto" variant="dark">Cart</Button>{' '}
                        </Nav>
                        </div>
                    </div>

                </Navbar>
            </header>
        );
    }
}

export default Header;
